import React from "react";
import { Link } from "react-router-dom";
import "../stylesheets/Nav.scss";
import "../stylesheets/Global.scss";

export default function Nav() {
  return (
    <nav className="nav--wrapper">
      <div className="nav--items">
        <Link to="/" className="nav--links_home">
          Work
        </Link>
        <p className="nav--text">
          I am afraid that our eyes are bigger than our stomachs, and that we
          have more curiosity than understanding. We grasp at everything, but
          catch nothing except wind.
        </p>
        <Link to="/projects" className="nav--links_projects">
          About
        </Link>
      </div>
    </nav>
  );
}
